  CONSTRAINT `FK_8159C5B9389561F4` FOREIGN KEY (`buena_pro`) REFERENCES `media` (`id`),
  CONSTRAINT `FK_8159C5B95693916D` FOREIGN KEY (`idclasf`) REFERENCES `adm_clasf_licencias` (`id`),
  CONSTRAINT `FK_8159C5B95CDD5538` FOREIGN KEY (`idoperadora`) REFERENCES `data_operadora` (`id`),
  CONSTRAINT `FK_8159C5B966902CCA` FOREIGN KEY (`contrato_firmado`) REFERENCES `media` (`id`),
  CONSTRAINT `FK_8159C5B97DBEBD8A` FOREIGN KEY (`idcentrohipico`) REFERENCES `data_centrohipico` (`id`),
  CONSTRAINT `FK_8159C5B9EE48A845` FOREIGN KEY (`idgerente_desafiliacion`) REFERENCES `sys_usuario` (`id`),
  CONSTRAINT `FK_8159C5B9EF681A03` FOREIGN KEY (`idgerente`) REFERENCES `sys_usuario` (`id`),
